:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Arthur Edward and TURNER, Caroline Emily (Emmy)
  WILLIAMS, Margery Turner and (cont...).
  They were the first WAACS to be attached to the Regiment. Margery was the only woman in the Sergeant's
  Mess. She was transferred to headquarters at Fort Dorset as Staff Sergeant and later (due to her mother's
  illness) she moved to Hawkes Bay where she was a Corporal in headquarters at Napier until the end of the
  war.
  02> WILLIAMS, Charles Leonard m on ** **, 1938 to FAULKNER, Eugenie Louise
  Frederick Turner
  b 11.10.1907 d ** ** 1976
  b ** ** **** d ** **.1978
  Charles was educated at Heretaunga School, Havelock North; Christ's College and Canterbury University. He
  became an electrical engineer and joined Turnbull and Jones where he became client advisor on the price of
  copper on the world market. His interests included miniature rifle shooting and he was several times
  champion of the Brooklyn Miniature Rifle Club and once represented New Zealand against Australia.
